package listaPara;

public class ListaPara_exercicio01 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	
		double resultado = 0;
		
		for (int i = 15; i < 201; i++) {
			resultado = Math.pow(i, 2);
			System.out.println(resultado);
		}
	}

}
//Exibe o quadrado dos inteiros dos números entre 15 a 200